import React from "react";

function Nav() {
  return (
    <nav className="navbar navbar-expand-lg ">
      <a className="navbar-brand" href="/">
        Search
      </a>
      <a className="navbar-brand" href="/shelf">
        Bookshelf
      </a>
    </nav>
  );
}

export default Nav;
